import React from "react";
import Nav from './Nav'

class App extends React.Component {
  constructor() {
    super();

    this.state = {appDate:Date()}
  }

  componentDidMount() {
    console.log(this.state.appDate)
  }

  render() {
    return(
    <Nav />
    )
  }
}

export default App;
